    /// <summary>
    /// Should the sheet name be quoted?
    /// </summary>
    /// <remarks>
    /// Sheet names can't contain <c>*</c>,<c>/</c>,<c>:</c>,<c>?</c>,<c>[</c>,<c>\</c>,
    /// <c>]</c>, but method doesn't check for that. Also, it can't start with <c>'</c>,
    /// though it can be non-first character.
    /// </remarks>
    /// <param name="sheetName">The name of a sheet. Must be at least 1 char long.</param>
    /// <returns>True, if the sheet name should be quoted in formula.</returns>
    internal static bool ShouldQuoteSheet(ReadOnlySpan<char> sheetName)
    {
        if (sheetName.Length == 0)
            throw new ArgumentException("Sheet name is empty.");

        // Exact semantic of astral planes is not yet known, but
        // let's require everything above BML needs to be quoted.
        // That is not actually true, e.g. 😀 must be quoted if
        // it is first character, but no quotes are required, if
        // it is a non-first character.
        if (char.IsHighSurrogate(sheetName[0]))
            return true;

        // The codepoint requires quotes as a first char.
        if (SheetFirst[sheetName[0]])
            return true;

        for (var i = 1; i < sheetName.Length; ++i)
        {
            // Character is not in BML -> quote. See note above.
            if (char.IsHighSurrogate(sheetName[i]))
                return true;

            // The codepoint requires quotes even as a non-first char
            if (SheetNext[sheetName[i]])
                return true;
        }

        return false;
    }
